import {
  HeaderImage,
  StyledNavbar,
  StyledContainer,
  RightContainer,
  Add,
  EnButton,
  Links,
  BurgerButton,
} from "./styles";
import logo from "./image1.svg";
import { FaSearch } from "react-icons/fa";
import {FontAwesomeIcon} from 'react-icons/fa';

export const Navbar = (probs) => {
  return (
    <StyledNavbar>
      <StyledContainer>
        <HeaderImage image={logo}>
          <img src={logo} alt="image" />
        </HeaderImage>
        <ul>
          <li>Movies</li>
          <li>TV Shows</li>
          <li>People</li>
          <li>More</li>
        </ul>
      </StyledContainer>
      <RightContainer>
        <Add />
        <EnButton>EN</EnButton>
        <Links>Login</Links>
        <Links>Join TMDB</Links>
        <Links> 
          <FaSearch size={20} color={"#00B4E4"}></FaSearch>
        </Links>
        <BurgerButton color=""></BurgerButton>
      </RightContainer>
    </StyledNavbar>
  );
};
